const request = require("supertest");
const mongoose = require("mongoose");
const { MongoMemoryServer } = require("mongodb-memory-server");
const app = require("../server");

// Set test environment
process.env.NODE_ENV = "test";

jest.setTimeout(10000);

let mongoServer;
let instructorToken;
let studentToken;
let courseId;
let newCourseId;

describe("Advanced E-Learning API Integration Tests", () => {
   beforeAll(async () => {
      try {
         // Connect to the in-memory MongoDB database before running the tests
         mongoServer = await MongoMemoryServer.create();
         const mongoUri = mongoServer.getUri();
         console.log("Attempting to connect to MongoDB at:", mongoUri);

         await mongoose.connect(mongoUri, {
            serverSelectionTimeoutMS: 5000, // 5 second timeout
         });

         console.log("Successfully connected to MongoDB");
      } catch (error) {
         console.error("Failed to connect to MongoDB:", error);
         throw error; // Re-throw to fail the test
      }
   });

   // Clean up database and close the connection after all tests are done
   afterAll(async () => {
      if (mongoServer) {
         await mongoose.connection.dropDatabase();
         await mongoose.connection.close();
         await mongoServer.stop();
      }
   });

   describe("User Authentication", () => {
      const instructorData = {
         name: "Test Instructor",
         email: "instructor@test.com",
         password: "password123",
         role: "instructor",
      };

      const studentData = {
         name: "Test Student",
         email: "student@test.com",
         password: "password123",
         role: "student",
      };

      // Test user registration
      describe("POST /api/auth/signup", () => {
         it("should register a new instructor", async () => {
            const res = await request(app)
               .post("/api/auth/signup")
               .send(instructorData);

            expect(res.status).toBe(201);
            expect(res.body.message).toBe("User created successfully");
            expect(res.body.user).toHaveProperty("email", instructorData.email);
         });

         it("should register a new student", async () => {
            const res = await request(app)
               .post("/api/auth/signup")
               .send(studentData);

            expect(res.status).toBe(201);
            expect(res.body.message).toBe("User created successfully");
            expect(res.body.user).toHaveProperty("email", studentData.email);
         });

         it("should not register a user with existing email", async () => {
            const res = await request(app)
               .post("/api/auth/signup")
               .send(instructorData);

            expect(res.status).toBe(400);
            expect(res.body.message).toBe("User already exists");
         });
      });

      // Test user login
      describe("POST /api/auth/login", () => {
         it("should login an instructor and return token", async () => {
            const res = await request(app).post("/api/auth/login").send({
               email: instructorData.email,
               password: instructorData.password,
            });

            expect(res.status).toBe(200);
            expect(res.body).toHaveProperty("token");
            instructorToken = res.body.token;
         });

         it("should login a student and return token", async () => {
            const res = await request(app).post("/api/auth/login").send({
               email: studentData.email,
               password: studentData.password,
            });

            expect(res.status).toBe(200);
            expect(res.body).toHaveProperty("token");
            studentToken = res.body.token;
         });

         it("should not login with invalid credentials", async () => {
            const res = await request(app).post("/api/auth/login").send({
               email: instructorData.email,
               password: "wrongpassword",
            });

            expect(res.status).toBe(400);
            expect(res.body.message).toBe("Invalid credentials");
         });
      });
   });

   describe("Course Management", () => {
      const courseData = {
         title: "Test Course",
         description: "This is a test course",
         duration: "10 weeks",
         price: 99.99,
      };

      // Test course creation
      describe("POST /api/courses", () => {
         it("should create a new course (instructor only)", async () => {
            const res = await request(app)
               .post("/api/courses")
               .set("Authorization", `Bearer ${instructorToken}`)
               .send(courseData);

            expect(res.status).toBe(201);
            expect(res.body.message).toBe("Course created successfully");
            expect(res.body.course).toHaveProperty("title", courseData.title);
            courseId = res.body.course._id;
         });

         it("should not allow student to create course", async () => {
            const res = await request(app)
               .post("/api/courses")
               .set("Authorization", `Bearer ${studentToken}`)
               .send(courseData);

            expect(res.status).toBe(403);
         });
      });

      // Test course retrieval
      describe("GET /api/courses", () => {
         it("should get all courses", async () => {
            const res = await request(app).get("/api/courses");

            expect(res.status).toBe(200);
            expect(Array.isArray(res.body)).toBeTruthy();
            expect(res.body.length).toBeGreaterThan(0);
         });
      });

      // Test course update
      describe("PATCH /api/courses/:courseId", () => {
         it("should update course (instructor only)", async () => {
            const updateData = {
               title: "Updated Test Course",
               price: 149.99,
            };

            const res = await request(app)
               .patch(`/api/courses/${courseId}`)
               .set("Authorization", `Bearer ${instructorToken}`)
               .send(updateData);

            expect(res.status).toBe(200);
            expect(res.body.course).toHaveProperty("title", updateData.title);
            expect(res.body.course).toHaveProperty("price", updateData.price);
         });

         it("should not allow student to update course", async () => {
            const res = await request(app)
               .patch(`/api/courses/${courseId}`)
               .set("Authorization", `Bearer ${studentToken}`)
               .send({ title: "Hacked Course" });

            expect(res.status).toBe(403);
         });
      });
   });

   describe("Course Enrollment", () => {
      // Test course enrollment
      describe("POST /api/courses/:courseId/enroll", () => {
         it("should allow student to enroll in course", async () => {
            const res = await request(app)
               .post(`/api/courses/${courseId}/enroll`)
               .set("Authorization", `Bearer ${studentToken}`);

            expect(res.status).toBe(201);
            expect(res.body.message).toBe("Enrolled successfully");
         });

         it("should not allow instructor to enroll", async () => {
            const res = await request(app)
               .post(`/api/courses/${courseId}/enroll`)
               .set("Authorization", `Bearer ${instructorToken}`);

            expect(res.status).toBe(403);
         });

         it("should not allow duplicate enrollment", async () => {
            const res = await request(app)
               .post(`/api/courses/${courseId}/enroll`)
               .set("Authorization", `Bearer ${studentToken}`);

            expect(res.status).toBe(400);
            expect(res.body.message).toBe("Already enrolled to this course");
         });
      });
   });

   describe("Course Analytics", () => {
      describe("GET /api/courses/analytics/summary", () => {
         it("should get course analytics (instructor only)", async () => {
            const res = await request(app)
               .get("/api/courses/analytics/summary")
               .set("Authorization", `Bearer ${instructorToken}`);

            expect(res.status).toBe(200);
            expect(res.body).toHaveProperty("totalCourses");
            expect(res.body).toHaveProperty("totalEnrollments");
         });

         it("should not allow student to access analytics", async () => {
            const res = await request(app)
               .get("/api/courses/analytics/summary")
               .set("Authorization", `Bearer ${studentToken}`);

            expect(res.status).toBe(403);
         });
      });
   });
});

require("dotenv").config();
const express = require("express");
const mongoose = require("mongoose");
const PORT = process.env.PORT;

const app = express();
app.use(express.json());

app.get("/", (req, res) => {
   res.status(200).send("Welcome to E-LEARNING API");
});

const authRouter = require("./src/routes/auth");
const courseRouter = require("./src/routes/courses");

app.use("/api/auth", authRouter);
app.use("/api/courses", courseRouter);

// Connect to MongoDB only when not in test environment
if (process.env.NODE_ENV !== "test") {
   mongoose
      .connect(process.env.MONGODB_URI, {
         serverSelectionTimeoutMS: 5000,
      })
      .then(() => console.log("Connected to Database"))
      .catch((error) => console.error("Connection error", error));
}

// Only start the server if this file is run directly
if (require.main === module) {
   app.listen(PORT, () => {
      console.log(`Listening on port ${PORT}`);
   });
}

module.exports = app;

import { Pool } from "pg";
import dotenv from "dotenv";

dotenv.config();

const db = new Pool({
  connectionString: process.env.DATABASE_URL,
  ssl: process.env.DATABASE_URL.includes("localhost")
    ? false
    : { rejectUnauthorized: false },
});

// Coba koneksi ke database
db.connect()
  .then(() => console.log("Connected to Database..."))
  .catch((err) => console.error("Database connection error:", err));

export { db };
